import React from 'react';
import Storys from './Storys';

export default function Body(){
  return(
    <MDBContainer className='pt-4' style={{marginLeft:'19vw', marginRight:'auto', minHeight: '100vh', maxWith:'50vw'}}>
      <Storys/>
    </MDBContainer>
  );
}
